import React from "react"
import NeedMoreCards from "./NeedMoreCards"
import StudyCards from "./StudyCards"
import NavBar from "../Nav"

export default function StudyMain({deck}){
    const {name, id, cards} = deck
    const navigation = {Home: "/", [name]: `/decks/${id}/`, "Study": " "}

    if(cards.length < 3){
        return <NeedMoreCards
        deckName={name}
        deckId={id}
        cardsLength={cards.length} />
    } else {
        return (
            <div>
                <NavBar
                navigation={navigation} />
                <h2>Study: {name}</h2>
                <StudyCards
                cards={cards} />
            </div>
        )
    }
}
